/**
 * @description
 * 현재 url이 path와 일치하면 component 렌더링
 */

const Route = ({ path, component }) => {
  const _path = path ? path : "/";
  if (_path === window.location.pathname) {
    return component;
  } else {
    return null;
  }
};

export default Route;
